import React,{ useState }  from 'react'
// import React, { useState } from 'react'
import './App.css'
import NavbarComponent from './navbar'
import LandingPage from './landingPage'
import FooterComponent from './footer'
import LoginAuth from './loginAuth'

function App(props){
    const [disp, setDisp] = useState('none')
    const loginAuthPage = () => {
        setDisp == 'none' ? setDisp = 'flex' : setDisp ='none';
    }


    return(
        <>
            <div className='main-body-wrapper'>
                <div className='navbar-component-wrapper'>
                    <NavbarComponent loginAuthPage={loginAuthPage}/>
                </div>
                <div className='landing-home-page'>
                    <LandingPage/>
                </div>
                <div className='landing-page-footer-container'>
                        <FooterComponent/>
                </div>
                <div className='login-auth-page-wrapper' >
                    <LoginAuth disp={disp}></LoginAuth>
                </div>  
            </div> 

        </>
    )
}

export default App;
